import React from 'react';
import cards from '../../components/cards/cards'


const home = () => {

const improvisando = [{
    nombre:"Santiago",
    numero:"123"
},{
    nombre:"Santi",
    numero:"1234"
},{
    nombre:"Santiago1",
    numero:"1235"
}]

  return (
    <div>
        <h1>FOOD</h1>
        <div>
            <cards info={improvisando}/>
        </div>
    </div>
  )
}

export default home
